@TiggerTherese @alistairbarron @hilarybennmp It is unlikely that MPs will do it in one step.
A vote for Benn means ERG and DUP would be desperate to stop process.
So you end up with a odd coalition of Remainers and Hard Brexiteers backing a 2nd Ref.

@hilarybennmp Parliament blocking a no deal Brexit outcome would raise very important issues regarding sovereignty; Here's why this matters: https://t.co/ROIxlXGWeq  #Brexit #sovereignty
https://t.co/KXQwQHlZCA  
Irascible Insights

@AngliaNature @hilarybennmp @seatsixtyone Too late to renegotate now.

We won't get an off the shelf Norway deal because we've proved untrustworthy.

The EU/EEA members, will need strict assurances that we're not using it as a stepping stone to an FTA.

@JimMBuzz @Itisallacademic @hilarybennmp @adampayne26 2/2
Why is this amendment framed by some people as a contest between Benn and Labour? Between the anti-leadership rebels and the frontbench?
We have the remarkable achievement of a PLP united in opposing the deal (only 2 defectors so far?), why create unneeded division?

@JimMBuzz @Itisallacademic @hilarybennmp @adampayne26 1/2
Indeed, the two differ in their 3rd parts. Hillary's, approved by the front bench, is to achieve what the Grieve amendment failed to do - to make Government's future motions amendable.
The 3rd part of the earlier one simply affirms the unanimous Conference policy.

@spayrechaynge @Itisallacademic @hilarybennmp @adampayne26 Labours 3rd clause is just a statement.  It doesnt do anything.

Benns 3rd clause, on the other hand, moves the decision making process forward by providing the legal base so that further amendments can be brought to decide Brexit.   
Its way better.

@storyofthemonth @hilarybennmp In the EU any member state can invoke A50 at any time if it's government wants to.
They just heed a good reason to. Which the Uk does not have.

Abd no - the meaningless, corrupt 2016 misled and marginal advisory referendum result is not a good reason
